import React from 'react';

const Tolist=()=>{
return(
    <>
    <div className='main_div'>
        <div className='centre_div'>
            <br/>
            <h1>ToDo List</h1>
            <br/>
            <input type='text' p/>
        </div>
    </div>
    </>
)
}
export default Tolist;
